{% extends "base.html" %}
<title>{% block title%}Generator Page{%endblock%}</title>

{% block content %}

<body>
    
    <h1 align="center" style="vertical-align: middle; color:white; font-size: 60px; position:relative; top: 25px; font-family: monospace, 'Courier New';">This is the generator page, get ready for take off!</h1><br>
    <div>
        <div align="center" style="height: 450px; width:400px; background-color:white; opacity: 0.5; color:rgb(9, 6, 48); vertical-align: middle; position:fixed; bottom:20px; margin-bottom: 20px; left:100px;"><br>
            <h3>Schedule</h3>
            <div style="position:relative; top: 5px; font-size: 18px;">
                {%for i in range (store_length)%}
                <ul><input type="checkbox"> {{store[i]}}</ul>
                {%endfor%}
                <button type="submit" class="btn btn-primary" style="background-color:rgb(9, 6, 48); border-color:none; color:white;">
                    <a href="{{url_for('selector.generator')}}" style="color:white;">New Schedule</a>
                </button>
            </div>
        </div>
    </div>

    <div style="height: 300px; width:200px; background-color: white; position:fixed; float: right; left: 1350px; top: 450px; bottom: 100px; opacity: .5; color:rgb(9, 6, 48);">
        <div style="position:relative; left:25px; top: 20px;">
            <h4>Sounds</h4>
            <form method="post", name="sound" >
                <div class="form-group">
                    <input type="checkbox" name="bell" id="bell" value="bell"/><label for="bell"> Bell</label><br>
                    <button type="button" class="btn btn-primary" align="center" style="text-align: center;width:75px; height:40px; position: center; color:white; text-align: center; background-color:rgb(9, 6, 48); border-color:none; ">Save</button>
                </div>
            </form>
        </div>
    </div>


    
    <div id="main">
        <div class="d-flex mb-3 justify-content-center">
            <input id="hours" class="form-control" type="number" min="0" name="hours" style="margin-right:10px; width:fit-content;"/>
            <input id="minutes" class="form-control" type="number" min="0" name="minutes" style="margin-right:10px; width:fit-content;">
            <input id="seconds" class="form-control" type="number" min="0" name="seconds" style="margin-right:10px; width:fit-content;">
        </div>
        <div class="d-flex justify-content-center">
            <button class="btn btn-outline-primary btn-start" style="color:white; margin:10px; background-color:rgb(9, 6, 48); border:none; border-radius: 50px;">Start</button>
            <button class="btn btn-outline-primary btn-pause" style="color:white; margin:10px;background-color:rgb(9, 6, 48); border:none; border-radius: 50px;">Pause</button>
            <button class="btn btn-outline-primary btn-stop" style="color:white; margin:10px;background-color:rgb(9, 6, 48); border:none; border-radius: 50px;">Stop</button>
            <button class="btn btn-outline-primary btn-reset" style="color:white; margin:10px;background-color:rgb(9, 6, 48); border:none; border-radius: 50px;">Reset</button>
        </div>
    </div>
    <script src="\static\js\main.js"></script>


</body>
